PRAGMA defer_foreign_keys=TRUE;
CREATE TABLE users (
  github_user_id TEXT PRIMARY KEY,
  username TEXT NOT NULL,
  app_installation_id TEXT,
  installation_token TEXT,
  token_expiry TIMESTAMP,
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);
CREATE TABLE auth_sessions (
  session_id TEXT PRIMARY KEY,
  github_user_id TEXT,
  state TEXT NOT NULL,
  status TEXT DEFAULT 'pending',
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP, code_verifier TEXT, code_challenge TEXT, code_challenge_method TEXT, redirect_uri TEXT, client_id TEXT,
  FOREIGN KEY (github_user_id) REFERENCES users(github_user_id)
);
CREATE TABLE jwt_tokens (
  jti TEXT PRIMARY KEY, -- JWT ID
  github_user_id TEXT NOT NULL,
  token_type TEXT NOT NULL, -- 'access' or 'refresh'
  expires_at TIMESTAMP NOT NULL,
  revoked BOOLEAN DEFAULT FALSE,
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (github_user_id) REFERENCES users(github_user_id)
);
CREATE TABLE oauth_clients (
  client_id TEXT PRIMARY KEY,
  client_secret TEXT,
  client_name TEXT NOT NULL,
  redirect_uris TEXT NOT NULL, -- JSON array
  grant_types TEXT NOT NULL, -- JSON array
  response_types TEXT NOT NULL, -- JSON array
  scope TEXT,
  contacts TEXT, -- JSON array
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);
CREATE TABLE oauth_state (state TEXT PRIMARY KEY, redirect_uri TEXT NOT NULL, created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP);
CREATE TABLE domains (id INTEGER PRIMARY KEY AUTOINCREMENT, user_id TEXT NOT NULL, domain TEXT NOT NULL, created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP, UNIQUE(user_id, domain), FOREIGN KEY (user_id) REFERENCES users(github_user_id));
CREATE TABLE api_tokens (
  token TEXT PRIMARY KEY,
  user_id TEXT NOT NULL,
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (user_id) REFERENCES users(github_user_id) ON DELETE CASCADE
);
CREATE TABLE user_tiers (
  user_id TEXT PRIMARY KEY,
  tier TEXT NOT NULL DEFAULT 'seed', -- 'seed', 'flower', 'nectar'
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (user_id) REFERENCES users(github_user_id) ON DELETE CASCADE
);
DELETE FROM sqlite_sequence;
CREATE INDEX idx_jwt_tokens_user_id ON jwt_tokens(github_user_id);
CREATE INDEX idx_jwt_tokens_expires_at ON jwt_tokens(expires_at);
CREATE INDEX idx_oauth_state_created ON oauth_state(created_at);
CREATE INDEX idx_api_tokens_user_id ON api_tokens(user_id);
CREATE INDEX idx_user_tiers_tier ON user_tiers(tier);
